import React from 'react';
import classes from './Slider.module.css'

const Slider = (props) => {

  let source = props.featured.source
  return (

    < div className={classes.Card} >
      <div style={{ content: source }} className={classes.Image}></div>
      <li className={classes.Name}>{props.name}</li>
      <button onClick = {props.back}></button>
        <ul className={classes.Content}>
          <li className={classes.Name}>{props.featuredItems.name}</li>
          <li className={classes.Price}>${props.featuredItems.Price}</li>
          <li className={classes.Description}>{props.featuredItems.Description}</li>
          {/* <div className={classes.ButtonContainer}> */}

          {/* </div> */}
        </ul>
        <button onClick = {props.forward}></button>


    </ div >
  )
}

export default Slider
